	(37,41,'Idée n 14590',1,0,'2016-06-09 11:32:00','2016-06-09 11:32:00'),
	(40,56,'Nous proposons un cendrier nouvelle génération connecté. Le principe est simple,récompenser le fumeur lorsqu\'il jette son mégot de cigarette dans le cendrier et non par terre. Soucieux de l\'environnement, énergie renouvelable et facile à trouver via géolocalisation.',8,9,'2016-09-12 16:52:35','2016-09-12 16:52:35'),
	(41,55,'Un cendrier permettant de recueillir l\'ensemble des mégots afin de reverser une somme à une association caritative (Recherche contre le cancer ou autre). Par tranche de 1000 mégots, 1€ serait reversé à cette association. Affichage numérique pour observer la somme acquise, les mégots restants. Poubelle à proximité pour recevoir les paquets de cigarette utilisés. Source de revenue : emplacement publicitaire pour les compagnies intéressées.',8,9,'2016-09-12 16:52:47','2016-09-12 16:52:47'),
	(42,58,'Cendrier grand format (poubelle) représentant une caricature d\'une personne connue, réelle ou fictive. Un mécanisme de pédale permet d\'ouvrir la bouche de la caricature (essentiellement pour les bars, boîtes de nuit, concert, éventuellement musée Grévin).\r\n\r\nGroupe : GUGLIERI, MIFSUD, RENON, PASCO, JAMROZIK, JOLY, GUIS',8,11,'2016-09-12 16:59:56','2016-09-12 16:59:56'),
	(43,62,'cendrier dans parc d\'attraction ou autre. Chaque mégot mis donne argent pour association. toit avec lumière chauffante et panneau solaire',8,13,'2016-09-12 17:02:40','2016-09-12 17:02:40'),
	(44,54,'Cendrier adaptable sur télésiège auquel chaque passager peut accéder. Le réservoir se vide à chaque montée des passagers. Ce cendrier sert aussi de poubelle.',8,12,'2016-09-12 17:05:45','2016-09-12 17:05:45'),
	(45,54,'Cendrier adaptable sur télésiège auquel chaque passager peut accéder. Le réservoir se vide à chaque montée des passagers. Ce cendrier sert aussi de poubelle.',8,12,'2016-09-12 17:05:45','2016-09-12 17:05:45'),
	(46,59,'Cendrier ludique incitant les fumeurs à jeter leurs mégots dans le cendrier. Le système comprend 3 trous suivi de trois partie tubulaire en plexis glace qui permettront de guider les mégots au bout. Un signal lumineux indiquera le gagnant. ',8,9,'2016-09-12 17:06:11','2016-09-12 17:06:11'),
	(47,68,'Cendrier Ecologique Portatif sur consigne à l\'éffigie de lieux populaires, réduisant l\'impact écologique de la cigarette.',8,11,'2016-09-12 17:13:41','2016-09-12 17:13:41');
